import React from 'react';

const Post = function(props) {

  return (
    <div className='post'>
      <div className='post__id'>{props.info.id}</div>
      <h1 className='post__header'>{props.info.head}</h1>
      <div className='post__content'>{props.info.text}</div>
      <button className='post__button'>Удалить</button>
    </div>
  )

}

export default Post
